import React from 'react';
import logo from './logo.svg';
import './App.css';
import Sidebar from './homepage/Sidebar';
import Homepage from './homepage/Homepage';
function App() {
  return (
    <div className="App">
      <div className="sideba-main">
        <Sidebar />

      </div>
      <div className="homepage">
          <Homepage />
      </div>

    </div>
  );
}

export default App;
